        /// <summary>
        /// Serializes the properties of <see cref="SubmitRequest"/>.
        /// </summary>
        /// <param name="writer"><see cref="Utf8JsonWriter"/></param>
        /// <param name="submitRequest"></param>
        /// <param name="jsonSerializerOptions"><see cref="JsonSerializerOptions"/></param>
        public void WriteProperties(Utf8JsonWriter writer, SubmitRequest submitRequest, JsonSerializerOptions jsonSerializerOptions)
        {
            
            writer.WritePropertyName("amount");
            JsonSerializer.Serialize(writer, submitRequest.Amount, jsonSerializerOptions);
            if (submitRequest.MerchantAccount != null)
                writer.WriteString("merchantAccount", submitRequest.MerchantAccount);

            writer.WritePropertyName("recurring");
            JsonSerializer.Serialize(writer, submitRequest.Recurring, jsonSerializerOptions);
            if (submitRequest.Reference != null)
                writer.WriteString("reference", submitRequest.Reference);

            if (submitRequest.SelectedRecurringDetailReference != null)
                writer.WriteString("selectedRecurringDetailReference", submitRequest.SelectedRecurringDetailReference);

            if (submitRequest.ShopperEmail != null)
                writer.WriteString("shopperEmail", submitRequest.ShopperEmail);

            if (submitRequest.ShopperReference != null)
                writer.WriteString("shopperReference", submitRequest.ShopperReference);

            if (submitRequest._AdditionalDataOption.IsSet)
            {
                writer.WritePropertyName("additionalData");
                JsonSerializer.Serialize(writer, submitRequest.AdditionalData, jsonSerializerOptions);
            }
            if (submitRequest._DateOfBirthOption.IsSet)
                writer.WriteString("dateOfBirth", submitRequest._DateOfBirthOption.Value!.Value.ToString(DateOfBirthFormat));

            if (submitRequest._EntityTypeOption.IsSet && submitRequest.EntityType != null) 
            {
                string? entityTypeRawValue = SubmitRequest.EntityTypeEnum.ToJsonValue(submitRequest._EntityTypeOption.Value!.Value);
                writer.WriteString("entityType", entityTypeRawValue);
            }
            
            if (submitRequest._FraudOffsetOption.IsSet)
                writer.WriteNumber("fraudOffset", submitRequest._FraudOffsetOption.Value!.Value);

            if (submitRequest._NationalityOption.IsSet)
                if (submitRequest.Nationality != null)
                    writer.WriteString("nationality", submitRequest.Nationality);

            if (submitRequest._ShopperNameOption.IsSet)
            {
                writer.WritePropertyName("shopperName");
                JsonSerializer.Serialize(writer, submitRequest.ShopperName, jsonSerializerOptions);
            }
            if (submitRequest._ShopperStatementOption.IsSet)
                if (submitRequest.ShopperStatement != null)
                    writer.WriteString("shopperStatement", submitRequest.ShopperStatement);

            if (submitRequest._SocialSecurityNumberOption.IsSet)
                if (submitRequest.SocialSecurityNumber != null)
                    writer.WriteString("socialSecurityNumber", submitRequest.SocialSecurityNumber);
        }
